1. Create a user model: First, create a user model in your MongoDB database to store user data, such as email and password. You can use a package like `bcrypt` to hash passwords before storing them in the database.
```javascript
const mongoose = require('mongoose');
const bcrypt = require('bcrypt');

const userSchema = new mongoose.Schema({
  email: { type: String, required: true, unique: true },
  password: { type: String, required: true },
});

userSchema.pre('save', async function (next) {
  const user = this;
  if (!user.isModified('password')) return next();
  const hash = await bcrypt.hash(user.password, 10);
  user.password = hash;
  next();
});

const User = mongoose.model('User', userSchema);

module.exports = User;
```
2. Implement a login route: Next, create a login route that allows users to log in and receive an authentication token. You can use a package like `jsonwebtoken` to generate and verify tokens.
```php
const express = require('express');
const bcrypt = require('bcrypt');
const jwt = require('jsonwebtoken');
const User = require('../models/user');

const router = express.Router();

router.post('/login', async (req, res) => {
  const { email, password } = req.body;

  const user = await User.findOne({ email });
  if (!user) {
    return res.status(401).json({ message: 'Invalid email or password' });
  }

  const isMatch = await bcrypt.compare(password, user.password);
  if (!isMatch) {
    return res.status(401).json({ message: 'Invalid email or password' });
  }

  const token = jwt.sign({ userId: user._id }, 'secret');
  res.json({ token });
});

module.exports = router;
```
3. Implement authorization middleware: Finally, implement a middleware function that verifies the authentication token and adds the user ID to the request object. You can then use this user ID to authorize access to specific routes or data.
```javascript
const jwt = require('jsonwebtoken');
const User = require('../models/user');

const authMiddleware = async (req, res, next) => {
  const token = req.headers.authorization?.split(' ')[1];
  if (!token) {
    return res.status(401).json({ message: 'Authentication required' });
  }

  try {
    const payload = jwt.verify(token, 'secret');
    const user = await User.findById(payload.userId);
    if (!user) {
      return res.status(401).json({ message: 'Authentication required' });
    }

    req.userId = user._id;
    next();
  } catch (err) {
    return res.status(401).json({ message: 'Authentication required' });
  }
};

module.exports = authMiddleware;
```
To use the authorization middleware, simply add it as a middleware function to any route that requires authentication.
