class SqlRepositoryStorage implements RepositoryStorageInterface {
  private $connection;
  private $tableName;
  private $entityMapping;

  public function __construct(PDO $connection, $tableName, $entityMapping) {
    $this->connection = $connection;
    $this->tableName = $tableName;
    $this->entityMapping = $entityMapping;
  }

