  }

  public function persist(EntityInterface $entity): void {
    // Implementation of the persist method goes here
  }

  public function commit(): void {
    $query = "INSERT INTO $this->tableName (";
    $values = array();

    // Build the SQL query to insert the new entities
    foreach ($this->entityMapping as $field) {
      $query .= "$field, ";
      $values[":$field"] = $entity->getField($field);
    }
    $query = rtrim($query, ', ') . ") VALUES (";
    foreach ($this->entityMapping as $field) {
      $query .= ":$field, ";
    }
    $query = rtrim($query, ', ') . ")";

    // Prepare the SQL statement and execute it
    $statement = $this->connection->prepare($query);
    $statement->execute($values);
  }
}
