To determine the number of completed fields in the form, including any fields that may be hidden by radio buttons or check boxes, you can use a recursive function that traverses the form tree and counts all the completed fields, including hidden fields.

Here's an example algorithm in JavaScript to do this:
```kotlin
function countCompletedFields(form, data) {
  let count = 0;

  // If this field is not visible, don't count it
  if (form.hasOwnProperty('hidden') && form.hidden === true) {
    return count;
  }

  // If this field has a value, increment the count
  if (data.hasOwnProperty(form.key) && data[form.key] !== null && data[form.key] !== "") {
    count++;
  }

  // If this field has children, recursively count them
  if (form.hasOwnProperty('components')) {
    for (let i = 0; i < form.components.length; i++) {
      // Recursively count the completed child fields
      count += countCompletedFields(form.components[i], data);
    }
  }

  return count;
}
```
This function takes two inputs: the form object and the data object that contains the user's responses to the form. The function recursively counts all the completed fields in the form, including those that are hidden based on radio button or check box selections. The `hidden` property is used to determine whether a field is hidden, and the function skips counting any hidden fields.

You can then call this function to determine the number of completed fields in your form:
```kotlin
const form = // Get your form data from form.io
const data = // Get the user's form responses
const completedFields = countCompletedFields(form, data);
```
This will give you the number of completed fields in your form, including any fields that may be hidden based on radio button or check box selections.

