type TimeParser struct {
    timezone string
}

func (tp *TimeParser) Parse(s string) (time.Time, error) {
    var t time.Time
    var err error

    unixTimestamp, err := strconv.ParseInt(s, 10, 64)
    if err == nil {
        if len(s) > 10 {
            t = time.Unix(0, unixTimestamp*int64(time.Millisecond))
        } else {
            t = time.Unix(unixTimestamp, 0)
        }
    } else {
        t, err = time.Parse(time.RFC3339, s)
    }

    if err == nil && tp.timezone != "" {
        loc, err := time.LoadLocation(tp.timezone)
        if err == nil {
            t = t.In(loc)
        }
    }

    return t, err
}
```
