```typescript
type Resolution = "D" | "W" | "M" | "Q" | "Y";

interface MultiplierAndResolution {
  multiplier: number;
  resolution: Resolution | "m" | "H";
}

function parseMultiplier(input: string): number | null {
  const parsed = parseInt(input, 10);
  return isNaN(parsed) ? null : parsed;
}

function minutesToHours(minutes: number): { multiplier: number; resolution: "m" | "H" } {
  const hours = minutes / 60;
  const multiplier = hours >= 1 ? hours : minutes;
  const resolution: "m" | "H" = hours >= 1 ? "H" : "m";
  return { multiplier, resolution };
}

function extractMultiplierAndResolution(input: string): MultiplierAndResolution | null {
  const matches = input.match(/^(\d+)?([DWMQY])?$/);

  if (!matches) {
    return null;
  }

  const [, multiplierStr, resolutionStr] = matches;

  if (multiplierStr && !resolutionStr) {
    const minutes = parseMultiplier(multiplierStr);
    if (minutes === null) {
      return null;
    }
    const { multiplier, resolution } = minutesToHours(minutes);
    return { multiplier, resolution };
  }

  if (!multiplierStr && resolutionStr) {
    const resolution = resolutionStr as Resolution;
    return { multiplier: 1, resolution };
  }

  if (multiplierStr && resolutionStr) {
    const multiplier = parseMultiplier(multiplierStr);
    const resolution = resolutionStr as Resolution;
    if (multiplier === null) {
      return null;
    }
    return { multiplier, resolution };
  }

  return null;
}
```
The function now includes a helper function `minutesToHours` that converts the number of minutes to hours if the number of minutes is greater than 59. If the input string contains only a number and it is greater than 59, the function will return the appropriate resolution, as demonstrated in the example input "240", which returns {multiplier: 4, resolution: "H"}.

