import React, { useState } from "react";

interface Register {
  name?: string;
  email?: string;
  token?: string;
}

const page = () => {
  const [name, setName] = useState<string>("");
  const [email, setEmail] = useState<string>("");
  const [token, setToken] = useState<string | null>(null);
  const [errorMessage, setErrorMessage] = useState<string | null>(null);

  const handleSubmit = async (e: React.FormEvent<HTMLFormElement>) => {
    e.preventDefault();

    try {
      const response = await fetch(`/api/auth`, {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ clientName: name, clientEmail: email }),
      });

      if (!response.ok) {
        throw new Error("An error occurred while fetching the book details");
      }

      const data: Register = await response.json();
      setToken(data.token);
      setErrorMessage(null);
    } catch (error) {
      setToken(null);
      setErrorMessage(error.message);
    }
  };

  return (
    <div className="flex flex-col mt-12 space-y-4 max-w-2xl w-full mx-auto">
      <div className="text-center">
        <h2 className="text-3xl font-semibold">Get Any Book Details</h2>
