const renderRSC = async () => {
  const response = await fetch('/path/to/renderRSC');
  const html = await response.text();

  // Extract the RSC data from the data script tag
  const dataScriptTag = document.querySelector('script[data-rsc-data]');
  const dataScript = dataScriptTag ? dataScriptTag.textContent.trim() : '';
  const rscData = JSON.parse(dataScript.substring(1, dataScript.length - 1));

  // Create a ReadableStream from the serialized RSC response
  const stream = new ReadableStream({
    start(controller) {
      controller.enqueue(new TextEncoder().encode(rscData.html));
      controller.close();
    },
  });

  // Create the RSC component from the ReadableStream and render it
  const RSCComponent = await createFromReadableStream(stream);
  render(RSCComponent, document.getElementById('root'), () => {
    console.log('RSC rendered successfully!');
  });
};

renderRSC();
