Here's an extension function on `Bucket` that fetches a `Collection` with a given name and creates it if it doesn't already exist. The function also has an optional parameter to specify a name for the scope to create and to create the scope if it doesn't exist.
```kotlin
import com.couchbase.client.core.error.ScopeNotFoundException
import com.couchbase.client.core.error.CollectionNotFoundException
import com.couchbase.client.java.Collection
import com.couchbase.client.java.CollectionExistsException
import com.couchbase.client.java.Scope
import com.couchbase.client.java.manager.collection.CollectionSpec
import com.couchbase.client.java.manager.collection.CollectionManager
import com.couchbase.client.java.manager.collection.CreateCollectionOptions
import com.couchbase.client.java.manager.collection.CreateScopeOptions

fun Bucket.getOrCreateCollection(
    scopeName: String,
    collectionName: String,
    createScope: Boolean = true
): Collection {
    var scope: Scope
    try {
        scope = this.scope(scopeName)
    } catch (e: ScopeNotFoundException) {
        if (!createScope) {
            throw e
        }

        val manager = this.collections()
        manager.createScope(scopeName, CreateScopeOptions())
        scope = this.scope(scopeName)
    }

    try {
        return scope.collection(collectionName)
    } catch (e: CollectionNotFoundException) {
        val manager: CollectionManager = this.collections()
        val collectionSpec = CollectionSpec.create(collectionName)
        try {
            manager.createCollection(
                collectionSpec, CreateCollectionOptions()
            )
        } catch (e: CollectionExistsException) {
            // someone else beat us to the punch, that's ok.
        }
        return scope.collection(collectionName)
    }
}
```
To use it, you can call:
```kotlin
